import React from 'react';
import '../styles/App.css';

const Footer = () => {
  return (
    <footer>
      <div className="footer-content">
        <p className="copyright">&copy; {new Date().getFullYear()} Cake Nygard</p>
        <p className="footer-links">
          <a href="https://www.instagram.com/cakenygardart/" target="_blank" rel="noopener noreferrer">Instagram</a>
          <span className="footer-divider">|</span>
          <a href="mailto:contact@cakenygard.com">Contact</a>
        </p>
      </div>
    </footer>
  );
};

export default Footer;
